import React from "react";

const Weather = () => {
    return (
        <div>
            {this.props.city &&
            <div>
            <p>Location: {this.props.city}, {this.props.country}</p>
            <p>Temprature: {this.props.temp}</p>
            <p>Pressure: {this.props.pressure}</p>
            <p>Sunset: {this.props.sunset}</p>
            < /div>
            }
            <p>{this.props.error}</p>
            </div>
        );
}



